func minOperations(nums1 []int, nums2 []int) int {
    // Swap to ensure the last element of each list is the maximum of its list
    n := len(nums1)
    max1, max2 := nums1[n-1], nums2[n-1]
    opCount := 0

    for i := 0; i < n; i++ {
        if nums1[i] > max1 {
            max1 = nums1[i]
        }
        if nums2[i] > max2 {
            max2 = nums2[i]
        }
    }

    for i := 0; i < n; i++ {
        if nums1[n-1] != max1 && nums1[i] == max1 {
            nums1[i], nums2[i] = nums2[i], nums1[i]
            opCount++
            break // Only one swap needed for nums1
        }
    }

    for i := 0; i < n; i++ {
        if nums2[n-1] != max2 && nums2[i] == max2 {
            nums1[i], nums2[i] = nums2[i], nums1[i]
            opCount++
            break // Only one swap needed for nums2
        }
    }

    if nums1[n-1] != max(nums1) || nums2[n-1] != max(nums2) {
        return -1
    }

    return opCount
}

func max(nums []int) int {
    maxVal := nums[0]
    for _, num := range nums {
        if num > maxVal {
            maxVal = num
        }
    }
    return maxVal
}
